aven't charges been laid? | The Only Witness Pt 2 Australian Story"},"description":{"simpleText":"A death on a lonely road, a woman shot at her own home and the one man who connects them both.\n\nConcluding the two-part story of the man who was the only witness to two deaths.\n\nWatch part 1 here: https://bit.ly/2VdOGVf\n\nFirst, he shot dead his wife in what he told police was a tragic accident.\n\nHe said he was looking for a snake in his garage on a chilly night in Toowoomba when his gun accidently discharged.\n\nSix years later he struck and killed a cyclist on a lonely stretch of highway. He was convicted of dangerous driving causing death.\n\nNow, a retired coroner, who has watched these cases unfold from the sidelines, is asking why the man has never had to face charges relating to the death of his wife.\n\nFor more from ABC News, click here: https://ab.co/2kd3ALi\nYou can watch more ABC News content on iview: https://ab.co/39iq2Xt\n\n___________________________________________\n\nWatch more Australian Story documentaries here: https://bit.ly/36ABH2J \nYou can also like us on Facebook: https://www.facebook.com/ABCAustralia.\nFollow us on Twitter: https://twitter.com/AustralianStory \n\nAbout Australian Story: Putting the \"real\" back into reality television, Australian Story is an award-winning documentary series with no narrator and no agendas — just authentic stories told entirely in people's own words. Take 30 minutes to immerse yourself in the life of an extraordinary Australian. They're sometimes high profile, sometimes controversial, but always compelling. It’s television guaranteed to make you think and feel. New episodes are available every Monday."},"lengthSeconds":"1926","ownerProfileUrl":"http://www.youtube.com/channel/UCxcrzzhQDj5zKJbXfIscCtg","externalChannelId":"UCxcrzzhQDj5zKJbXfIscCtg","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","B
